import React,{Component} from 'react';
import Post from "./Post";
export default class Posts extends Component{
    render() {
        return(
            <div className="left">
                <Post src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fi.pinimg.com%2Foriginals%2F0c%2F3b%2F3a%2F0c3b3adb1a7530892e55ef36d3be6cb8.png&imgrefurl=https%3A%2F%2Fwww.pinterest.com%2Fpin%2F814588651336180940%2F&tbnid=gzW4aEW--xWE9M&vet=12ahUKEwjQ6J2BlcDsAhWV_4UKHTmBDCkQMygDegUIARCbAQ..i&docid=ng65lblIjpURRM&w=376&h=376&q=user%20icon&ved=2ahUKEwjQ6J2BlcDsAhWV_4UKHTmBDCkQMygDegUIARCbAQ"  
                alt="usr_icon"/>
            </div>
        )
    }
}
